export interface Expenses {
  id: number;
  category: string;
  money: string;
}

export type Action =
  | {
      type: "CREATE";
      data: {
        id: string;
        money: string;
      };
    }
  | {
      type: "EDIT";
      data: {
        id: string;
        money: string;
      };
    }
  | {
      type: "DELETE";
      id: string;
    };
